description:
In an ideal world what would you like to happen when two sexy brunettes girls are alone together in a room? Well this shoot conclusively answers that question... un-
restrained, passionate girl on girl action!

Short haired Tricia gives in to Jaclyn\'s advances and soon they find themselves passionately enveloped in each other. Stray hands and wandering tongues don\'t take long to find where they want to be, culminating in some intensely steamy midday fun.

